    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1957. The report begins by summarizing the weather conditions and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include fur harvesting and timber removal.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and violations. N-R forms and photographs are attached.",nt"owner_org":
